import { Link, Route, Router } from "react-router-dom";
import Heading from "../layout/Heading";
import AddPost from "./Add";
import EditPost from "./Edit";
import PostList from "./PostList";

export default function Admin() {
	return (

		<div className="admin-container">
			<Heading size="1" content="Admin" />
			<Router>
				<Route path="/add" exact element={<AddPost/> }/>
              <Route path="/edit" exact element={<EditPost/> }/>
              <Route path="/edit/:id" exact element={<EditPost/> }/>
              <Route path="/adminContact" exact element={<AdminContact/> }/>
			</Router>
				<Link to="/add">Legg til Referanser</Link>
				<Link to="/edit">Redigere Referanser</Link>
				<Link to="/adminContact">Kommentarer</Link>
			<PostList/>
		</div>
	);
}
